<!DOCTYPE html>
<html>
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Checkpoint</title>
    <style>
      * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
        overflow: hidden;
      }

      @keyframes race1 {
        from {
          transform: translateX(0);
        }
        to {
          transform: translateX(750%);
        }
      }

      @keyframes race2right {
        to {
          left: 92%;
        }
      }

      @keyframes turnLeft {
        to {
          rotate: -90deg;
        }
      }

      @keyframes race2up {
        to {
          top: 50%;
        }
      }

      #car {
        left: 0;
        top: 10%;
        max-height: 5%;
        position: absolute;
        z-index: 4;
        /*left: 43.5%;*/
        left: 43.5%;
        top: 92.3%;
        animation: race1 2s;
      }

      @keyframes dash {
        to {
          stroke-dashoffset: 0;
        }
      }

      .box {
        position: relative;
        height: 100vh;
        width: 100vw;
        display: flex;
        align-items: center;
      }

      .map {
        display: flex;
        width: 100%;
        position: relative;
      }

      .bridge {
        fill: none;
        stroke-width: 51px;
        position: absolute;
        stroke: grey;
        z-index: 4;
        height: 100%;
        width: 100%;
      }

      .cp {
        position: absolute;
      }
      /*
      #path1 {
        visibility: hidden;

      #path2 {

      #path3 {

      #path4 {

      #path5 {

      #path7 {
        visibility: hidden;
      }

      #path8 {
        visibility: hidden;
      }

      #path9 {
        visibility: hidden;
      }

      #path10 {
        visibility: hidden;
      }*/

      .path {
        fill: none;
        position: absolute;
        stroke-width: 15px;
        stroke: rgb(255, 94, 0);
        height: 100%;
        width: 100%;
        /*stroke-dasharray: 10000;
        stroke-dashoffset: 10000;*/
        z-index: 3;
      }
    </style>
